import React from 'react';
import { Link } from 'react-router-dom';
import './gymbro.css';

function Gymbro() {
    return (
        <div className="gymbroBody">
            <nav className="landingNav">
                <Link to="/">
                    <img
                        src="/logo192.png"
                        alt="logo"
                        className="App-logo"
                        width={50}
                        height={50}
                    />
                </Link>

                <div>
                    <Link to="/login" className="App-link">Login</Link>
                    <Link to="/register" className="App-link">Register</Link>
                </div>
            </nav>

            <div className="card">
                {/* Card content can go here */}
            </div>
        </div>
    );
}

export default Gymbro;
